      "test.ts": "pins.D13.digitalWrite(true);\n\nlet on = false;\npause(1000);\n\nfor(let i = 1000; i > 0; i -= 50) {\n    pins.D13.digitalWrite(on = !on);\n    music.playTone(440, i)\n}\n\nfor(let i = 0; i < 1000; i += 20){\n    pins.D13.digitalWrite(on = !on);\n    music.playTone(440, i)\n}\n"
