      "pxt.json": "{\n    \"name\": \"light\",\n    \"description\": \"The programmable LED (WS2812b) driver.\",\n    \"files\": [\n        \"README.md\",\n        \"neopixel.cpp\",\n        \"neopixel.ts\",\n        \"create.ts\",\n        \"shims.d.ts\",\n        \"enums.d.ts\",\n        \"ns.ts\",\n        \"neopixeloverrides.ts\",\n        \"animations.jres\",\n        \"pxtparts.json\"\n    ],\n    \"testFiles\": [\n        \"test.ts\"\n    ],\n    \"public\": true,\n    \"dependencies\": {\n        \"core\": \"*\"\n    },\n    \"targetVersions\": {\n        \"target\": \"0.5.38\"\n    },\n    \"icon\": \"/pxt-maker/docs/static/libs/light.png\"\n}",
      "pxtparts.json": "{\n   \"neopixel\": {\n       \"simulationBehavior\": \"neopixel\",\n       \"visual\": {\n           \"builtIn\": \"neopixel\",\n           \"width\": 58,\n           \"height\": 113,\n           \"pinDistance\": 9,\n           \"pinLocations\": [\n               {\"x\": 10, \"y\": 0},\n               {\"x\": 19, \"y\": 0},\n               {\"x\": 28, \"y\": 0}\n           ]\n       },\n       \"numberOfPins\": 3,\n       \"pinDefinitions\": [\n           {\"target\": {\"pinInstantiationIdx\": 0}, \"style\": \"solder\", \"orientation\": \"+Z\"},\n           {\"target\": \"threeVolt\", \"style\": \"solder\", \"orientation\": \"+Z\"},\n           {\"target\": \"ground\", \"style\": \"solder\", \"orientation\": \"+Z\"}\n       ],\n       \"instantiation\": {\n           \"kind\": \"function\",\n           \"fullyQualifiedName\": \"light.createStrip\",\n           \"argumentRoles\": [\n               {\"pinInstantiationIdx\": 0, \"partParameter\": \"pin\"},\n               {\"partParameter\": \"mode\"}\n           ]\n       },\n       \"assembly\": [\n           {\"part\": true, \"pinIndices\": [2]},\n           {\"pinIndices\": [0, 1]}\n       ]\n   }\n}",
      "shims.d.ts": "// Auto-generated. Do not edit.\n\n\n    /**\n     * Functions to operate colored LEDs.\n     */\n    //% weight=100 color=\"#0078d7\" icon=\"\\uf00a\"\ndeclare namespace light {\n\n    /**\n     * Get the default pin for the built-in neopixels\n     */\n    //% parts=\"neopixel\"\n    //% help=light/default-pin shim=light::defaultPin\n    function defaultPin(): DigitalInOutPin;\n\n    /**\n     * Send a neopixel buffer to the specified digital pin\n     * @param pin The pin that the neopixels are connected to\n     * @param mode the color encoding mode\n     * @param buf The buffer to send to the pin\n     */\n    //% parts=\"neopixel\" shim=light::sendBuffer\n    function sendBuffer(pin: DigitalInOutPin, mode: int32, buf: Buffer): void;\n}\n\n// Auto-generated. Do not edit. Really.\n",
